import React, {Component} from "react";
import axios from "axios";
import { createUser } from "../converters/userConverter";
import { ApiurlUsers1 } from "../services/apirest";
import { ApiurlRoles } from "../services/apirest";
import swal from 'sweetalert';



class IngresarUsuario extends Component{



  state = {
    form:{
          
            "number": "",
            "validator": "",
            "name": "",
            "last_name": "",
            "second_last_name": "",
            "birthdate": "",
            "email": "",
            "password": "",
            "code": "",
            
                                
    },
    error:false,
    errorMsg:"",
    roles:[]
   
}




    manejadorChange = async (e) => {
        await this.setState({
          form: {
            ...this.state.form,
            [e.target.name]: e.target.value,
          },
        });
      };


      manejadorSubmit = (e) => {
        e.preventDefault();
      };

componentDidMount(){
  axios
      .get("https://siglo-xxi-users.azurewebsites.net/Users/v1/roles")
      .then((response) => this.setState({ roles: response.data.roles }));
}

      post = () => {
        let url = ApiurlUsers1;
        console.log(this.state);
        const body = createUser(this.state.form);
        axios
          .post(url, body)
          .then((response) => {
            
          swal(
            'Usuario Creado',
            'El Usuario fue creado exitosamente.',
            'success' 
        )
        
            console.log(response.data);
            this.props.history.push("/dashboard");
          })
          .catch((error) => console.log(error.response.data));
      };
    
  

      


    render(){   
      const form = this.state.form;
        return(
               
          <React.Fragment>

          <br/>
          
          <div className="container">
                     <h3>Ingresar Usuario </h3>
          </div>
          <br/>
          <div className="container">
          <form className="form-horizontal" onSubmit={this.manejadorSubmit}>
        
         
 
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Rut</label>
                     <div className="col-md-8">
                         <input className="form-control" name="number" placeholder="rut" type="text" 
                         value={form.number  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
                 

                 
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Digito verificador</label>
                     <div className="col-md-8">
                         <input className="form-control" name="validator" placeholder="Digito verificador" type="text" 
                         value={form.validator  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 
            
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Nombre</label>
                     <div className="col-md-8">
                         <input className="form-control" name="name" placeholder="Nombre" type="text" 
                         value={form.name  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 

                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Apellido Paterno</label>
                     <div className="col-md-8">
                         <input className="form-control" name="last_name" placeholder="Apellido paterno" type="text" 
                         value={form.last_name  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Apellido materno</label>
                     <div className="col-md-8">
                         <input className="form-control" name="second_last_name" placeholder="Apellido materno" type="text" 
                         value={form.second_last_name  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 
            
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Fecha de nacimiento</label>
                     <div className="col-md-8">
                         <input className="form-control" name="birthdate" placeholder="Fecha de nacimiento" type="text" 
                         value={form.birthdate  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 
            
                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Correo electronico</label>
                     <div className="col-md-8">
                         <input className="form-control" name="email" placeholder="email" type="text" 
                         value={form.email  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>

                 <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Contraseña</label>
                     <div className="col-md-8">
                         <input className="form-control" name="password" placeholder="Contraseña" type="text" 
                         value={form.password  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
                 <br/>
 
            



              {/*   <div className="row">
                      <div className="col-sm-8">
                     <label className="col-md-2 control-label">Rol 1-5</label>
                     <div className="col-md-8">
                         <input className="form-control" name="code" placeholder="codigo rol" type="text" 
                         value={form.code  || ''}
                         onChange={this.manejadorChange}
                         />
                       </div>
                </div>
                 </div>
        <br/>*/}
 

                
          <div className="row">
              <div className="col-sm-4">
                <label className="col-md-2 control-label">Role</label>
                <div className="col-md-6">
                  <select
                    className="form-select"
                    name="code"
                    value={this.state.form.code}
                    onChange={this.manejadorChange}
                  >
                    {this.state.roles.map((role) => {
                      return <option key={role.code} value={role.code}>{role.name}</option>
                    })}
                  </select>
                </div>
              </div>
            </div>

            <br />      
            
                 
            


            



      
 
               <button 
               type="submit"
                className="btn btn-primary"
                 style={{ marginRight: "10px" }}
                 onClick={() => this.post()}
                 >
                   Agregar usuario
                 </button>
 
             
               <a className="btn btn-dark" href="/dashboard" >Salir</a>
               
           
           </form>
           </div>
         </React.Fragment>
        
               
        );
    }

}


export default IngresarUsuario;
